import 'bootstrap/dist/css/bootstrap.min.css';
import { NavigateFunction, useNavigate } from "react-router-dom";
import Cookies from 'js-cookie';

const App = () =>{
  const Navigate:NavigateFunction = useNavigate();
  const reg = () =>{
    Navigate('/register')
  }
  const login = () =>{
    Navigate('/login')
  }
  const logout = () =>{
    Cookies.remove('access_token');
    Navigate('/login')
  }
  return(
    <><a href='index.html'></a></>
  )
}
export default App;
